double det(struct vector a, struct vector b, struct vector c, struct vector d){
	return a.x1 * b.x2 * c.x3 * d.x4 + a.x1 * b.x4 * c.x2 * d.x3 + a.x1 * b.x3 * c.x4 * d.x2 +
		   a.x2 * b.x4 * c.x3 * d.x1 + a.x2 * b.x3 * c.x1 * d.x4 + a.x2 * b.x1 * c.x4 * d.x3 +
		   a.x3 * b.x1 * c.x2 * d.x4 + a.x3 * b.x2 * c.x4 * d.x1 + a.x3 * b.x4 * c.x1 * d.x2 +
		   a.x4 * b.x3 * c.x2 * d.x1 + a.x4 * b.x2 * c.x1 * d.x3 + a.x4 * b.x1 * c.x3 * d.x2 -
		   a.x1 * b.x4 * c.x3 * d.x2 - a.x1 * b.x3 * c.x2 * d.x4 - a.x1 * b.x2 * c.x4 * d.x3 -
		   a.x2 * b.x1 * c.x3 * d.x4 - a.x2 * b.x3 * c.x4 * d.x1 - a.x2 * b.x4 * c.x1 * d.x3 -
		   a.x3 * b.x4 * c.x2 * d.x1 - a.x3 * b.x1 * c.x4 * d.x2 - a.x3 * b.x2 * c.x1 * d.x4 -
		   a.x4 * b.x1 * c.x2 * d.x3 - a.x4 * b.x2 * c.x3 * d.x1 - a.x4 * b.x3 * c.x1 * d.x2;
}

struct vector solve(struct vector a, struct vector b, struct vector c, struct vector d){
	struct vector solution;
	solution.x1 = -100.0;
	solution.x2 = -100.0;
	solution.x3 = -100.0;
	solution.x4 = -100.0;
	double delta = det(a, b, c, d);
	if (delta == 0)
		return solution;
	else{
		double delta_1, delta_2, delta_3, delta_4;
		delta_1 = det(set_to_one(a, 1), set_to_one(b, 1), set_to_one(c, 1), set_to_one(d, 1));
		delta_2 = det(set_to_one(a, 2), set_to_one(b, 2), set_to_one(c, 2), set_to_one(d, 2));
		delta_3 = det(set_to_one(a, 3), set_to_one(b, 3), set_to_one(c, 3), set_to_one(d, 3));
		delta_4 = det(set_to_one(a, 4), set_to_one(b, 4), set_to_one(c, 4), set_to_one(d, 4));
		solution.x1 = (1 / delta) * delta_1;
		solution.x2 = (1 / delta) * delta_2;
		solution.x3 = (1 / delta) * delta_3;
		solution.x4 = (1 / delta) * delta_4;
		return solution;
	}
}


struct vector subsystem(struct vector a, struct vector b, struct vector c, struct vector d){
	
	struct vector solution;
	solution.x1 = -100.0;
	solution.x2 = -100.0;
	solution.x3 = -100.0;
	solution.x4 = -100.0;
	double poebota1 = a.x1 * b.x2 - a.x2 * b.x1, poebota2 = poebota1 * a.x1;
	double poebota3 = c.x3 + c.x1 * (a.x1 * a.x2 * b.x3 + a.x2 * a.x3 * b.x1 - a.x1 * a.x3 * b.x2 + a.x2 * a.x3 * b.x1) / poebota2 - (c.x2 * (a.x1 * b.x3 + a.x3 * b.x1) / poebota1);
	if ((a.x1 == 0) || (poebota1 == 0) || (poebota3 == 0))
		return solution;
	else{
		double q1, q2, q3;
		q1 = 1 - a.x4/d.x4; q2 =1 - b.x4/d.x4; q3 = 1 - c.x4/d.x4;
		solution.x3 = (q3 - (c.x1 * q1 * poebota1 - ((c.x1 * a.x2 * (a.x1 * q2 - b.x1 * q1)) / poebota2)) - ((c.x2 * (a.x1 * q2 - b.x1 * q1)) / poebota1)) / poebota3;
		solution.x2 = (q2 * a.x1 - b.x1 * q1 - (solution.x3 * (a.x1 * b.x3 + b.x1 * a.x3))) / poebota1;
		solution.x1 = (q1 - a.x2 * solution.x2 - a.x3 * solution.x3) / a.x1;
		solution.x4 = (1 - d.x1 * solution.x1 - d.x2 * solution.x2 - d.x3 * solution.x3) / d.x4;
		//timer = clock();
		//fprintf(output, "solution finished : %d\n", timer);
		return solution;
	}
	
}
