double dispersion(double* numbers, int n){
	int i;
	double mid = 0.0, res = 0.0;
	for (i = 0; i < n; i++)
		mid += numbers[i];
	mid /= (double)n;
	for (i = 0; i < n; i++)
		res += fabs(numbers[i] - mid);
	return res;
}

struct vector compute_solution(struct vector* factor, int n, int param){
	double i1, i2, i3, i4;
	double* y = (double*)malloc(n * sizeof(double));
	double step = 1.0 / param, min_disp = 1000.0;
	struct vector solution;
	solution.x1 = -100.0;
	solution.x2 = -100.0;
	solution.x3 = -100.0;
	solution.x4 = -100.0;
	int count = 0, j, check = 1;
	for (i1 = step / 2.0; i1 < 1; i1 += step)
		for (i2 = step / 2.0; i2 < 1; i2 += step)
			for (i3 = step / 2.0; i3 < 1; i3 += step)
				for (i4 = step / 2.0; i4 < 1; i4 += step){
					check = 1;
					for (j = 0; j < n; j++){
						y[j] = factor[j].x1 * i1 + factor[j].x2 * i2 + factor[j].x3 * i3 + factor[j].x4 * i4;
						if (y[j] < 0)
							check = 0;
					}
					if (check){
						double disp = dispersion(y, n);
						if (disp < min_disp){
							min_disp = disp;
							solution.x1 = i1;
							solution.x2 = i2;
							solution.x3 = i3;
							solution.x4 = i4;
						}
					}
				}
	free(y);
	return solution;
}

int is_true(big_int *cube, int index) {
	//printf("In is_true(index):\n");
	int ind = index / sizeof_big_int;
	int bit_number = sizeof_big_int - 1 - (index % sizeof_big_int);
	//printf("Ind & bit_number: %d %d\n", ind, bit_number);
	//printf("Out of is_true(index)\n");
	return ((cube[ind] & (1LL << bit_number)) >> bit_number);
}
void write_cube_true(big_int *cube, int index) {
	int ind = index / sizeof_big_int;
	int bit_number = sizeof_big_int - 1 - (index % sizeof_big_int);
	cube[ind] |= (1LL << bit_number);
	return;
}
